<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="utf-8" />
    <meta http-equiv="X-UA-Compatible" content="IE=edge" />
    <link
      rel="shortcut icon"
      href="./assets//img//baboon-logo_icon_draft_1x1 (1)"
    />
    <meta
      name="viewport"
      content="width=device-width, initial-scale=1, shrink-to-fit=no"

    <meta
      name="description"
      content="Ultraland page template or product landing page template helps you easily create websites for your app or product,  landing page template form promotion and many more."
    />
    <meta name="author" content="ThemeTags" />

    <!-- OG Meta Tags to improve the way the post looks when you share the page on LinkedIn, Facebook, Google+ -->
    <meta property="og:site_name" content="" />
    <!-- website name -->
    <meta property="og:site" content="" />
    <!-- website link -->
    <meta property="og:title" content="" />
    <!-- title shown in the actual shared post -->
    <meta property="og:description" content="" />
    <!-- description shown in the actual shared post -->
    <meta property="og:image" content="" />
    <!-- image link, make sure it's jpg -->
    <meta property="og:url" content="" />
    <!-- where do you want your post to link to -->
    <meta property="og:type" content="article" />

    <!--title-->
    <title>Baboon &amp;</title>

    <!--favicon icon-->
    <link
      rel="icon"
      href="./assets//img//baboon-logo_icon_draft_1x1 (1).png"

      sizes="16x40"
    />

    <!--build:css-->
    <link
      rel="stylesheet"
      href="dependencies/bootstrap/css/bootstrap.min.css"
      type="text/css"
    />
    <link
      rel="stylesheet"
      href="dependencies/fontawesome/css/all.min.css"
      type="text/css"
    />
    <link
      rel="stylesheet"
      href="dependencies/components-elegant-icons/css/elegant-icons.min.css"

    />

    />
    <link
      rel="stylesheet"

      type="text/css"
    />
    <!-- Site Stylesheet -->
    <link rel="stylesheet" href="assets/css/app.css" type="text/css" />

    <link
      href="https://fonts.googleapis.com/css2?family=Inter:wght@300;400;500;600;700;800&display=swap"
